text:
@gabefollower @csco_dev @sbox I'm not a huge fan of creating "full games" in S&amp;Box, specially when you could release on Steam as a full standalone game.

S&amp;Box is Source 2's Roblox. It just feels weird to be very dependent on a game once again, I kinda have PTSD from that now.

S&amp;Box is very cool nonetheless.
